import React from "react";
import classes from "./Home.module.css";
const Home = () => {
    return (
        <>
        <div className={`${classes.neon_wrap}`}>
        <h1 className={`${classes.title} ${classes.fade_in}`}>Sew Lovely</h1>
        </div>
        </>
    )
}

export default Home;
